import re

def palindrome_of_length_at_least_n(s):
    s = s.lower()
    palindromes = set()
    for i in range(len(s)):
        for j in range(i + 10, len(s) + 1):
            substring = s[i:j]
            if re.match(r'^[a-z]+$', substring) and substring == substring[::-1]:
                palindromes.add(substring)
    return palindromes
